column13:
The following post uses an Excite tactic:
@WBrettWilson "Nearly half of Canadians say they plan to buy an electric vehicle as cost concerns fade"... https://t.co/ZQQuop4UGI #CdnPoli #CPC #CPCNonsense

This post elicits a positive emotion by highlighting a positive trend in the adoption of electric vehicles and the fading cost concerns related to them.
